import './App.css';
import {BrowserRouter as Router, Route } from 'react-router-dom';
import Navbar from './components/Navbar'

function App() {
  return (
    <>
     <Router>
        <Route exact path='/' >
          <Navbar />
        </Route>
    </Router>
    </>
  );
}

export default App;
